import React from 'react';

interface Props {
    data?: {};
}

const Journals: React.FC<Props> = (props) => {
    const results: any = props.data;
    console.log(results);
    return (
        <>
            <div>{Object.keys(results).map((key) => results[key])}</div>
        </>
    );
};

export default Journals;
